import React from "react";
import Banner from "./Banner";
import "../style/_ficheLogement.scss";

class Rate extends React.Component {
  render() {
    return (
      <div>
        <img class="rate" src="../images/rate_star_full.png"></img>
        <img class="rate" src="../images/rate_star_full.png"></img>
        <img class="rate" src="../images/rate_star_full.png"></img>
        <img class="rate" src="../images/rate_star_empty.png"></img>
        <img class="rate" src="../images/rate_star_empty.png"></img>
      </div>
    );
  }
}

export default Rate;
